    "2016-01-28T07:27:30.560521",nt"name": "unemployment-insurance-initial-claims-statewide-by-month-beginning-1971",nt"isopen":
    false,nt"url": null,nt"notes": "Dataset contains monthly counts, from 1971
    to present, of initial claims for regular unemployment insurance benefits.rnInitial
    Claims include new claims as well as subsequent additional claims filed. New claims
    are filed in person, by mail, telephone or other means to request a determination
    of entitlement to and eligibility for compensation which results in an agency generated
    document of an appealable monetary determination provided to the potential claimant.
    Additional claims are filed during an existing benefit year due to new unemployment
    when a break of one week or more has occurred in the claim series due to intervening
    employment.rnData are provided for New York State. Counts include only state residents
    who file a claim (excluding out-of-state residents).",nt"license_title": "License
